import Nav from "../Nav";
import Helmet from "react-helmet";
import React from "react";
import Canvas from "./Canvas";

export default function Portfolio() {
  const draw = (ctx, frameCount) => {
    ctx.clearRect(0, 0, ctx.canvas.width, ctx.canvas.height);
    ctx.fillStyle = "white";
    ctx.beginPath();
    ctx.arc(50, 100, 20 * Math.sin(frameCount * 0.05) ** 2, 0, 2 * Math.PI);
    ctx.fill();
    var cur_rects = createRects();
    drawRects(ctx, cur_rects);
  };
  return (
    <div>
      <Nav />
      <Canvas draw={draw} />
    </div>
  );
}

function createRects() {
  var rects = [];
  for (var row = 0; row < 10; row++) {
    var rects_add = [];
    for (var spot = 0; spot < 10; spot++) {
      rects_add.concat(new Rectangle(spot * 10, row));
    }
    rects.concat(rects_add);
  }
  return rects;
}
function drawRects(ctx, cur_rects) {
  var rects = [];
  for (var row = 0; row < 10; row++) {
    ctx.fillStyle = "white";
    ctx.beginPath();
    ctx.rect(cur_rects.x, cur_rects.y, 10, 10);
    ctx.fill();
  }
}
class Rectangle {
  constructor(x, y) {
    this.x = x;
    this.y = y;
  }
}
